import React from 'react';
import PropTypes from 'prop-types';
import Grid from '@mui/material/Grid';
import IndividualChannelCard from '../Components/IndividualChannelCard';

const FullPodcastList = (props) => {
  const { channels } = props;

  return (
    <Grid container spacing={3}>
      {channels.slice.map((channel) => (
        <Grid item xs={3}>
          <IndividualChannelCard channel={channel} />
        </Grid>
      ))}
    </Grid>
  )
}

FullPodcastList.propTypes = {
  channels: PropTypes.array.isRequired,
};


export default FullPodcastList;
